window.bookSummaryJSON = "<p><b>Chaos is descending on the City of Ancients.</b><br> <br> The Twilight Ascent is coming to a boil. The Eveningtide Asura's plans are nearing fruition, while powerful factions try to block his ascent. The survival of Twilight Harbor and its citizens depends on who's victorious. Zac finds himself tied to the asura's chariot, but that's only one of his problems.<br> <br> Uona Noz'Valadir has stolen the Splinter of Oblivion, leaving Zac with a ticking time bomb of Creation in his body. A trap has been set within the City of Ancients, but Zac has no choice but to enter the belly of the beast.<br> <br> A final battle awaits, and Zac is determined to show everyone the price of meddling with his path.</p> <p><b>Book 9 of the hit Defiance of the Fall LitRPG series is coming soon. Grab your copy today!</b></p>"; 
